import React, { useEffect, useState } from 'react';
import api from '../../services/api';

interface Booking {
  id: number;
  cottage_id: number;
  check_in: string;
  check_out: string;
  status: string;
  weekday_credits_used: number;
  weekend_credits_used: number;
  created_at: string;
}

const MyTrips: React.FC = () => {
  const [bookings, setBookings] = useState<Booking[]>([]);
  const [loading, setLoading] = useState(true);
  const [selectedBooking, setSelectedBooking] = useState<any>(null);

  useEffect(() => {
    fetchTrips();
  }, []);

  const fetchTrips = async () => {
    try {
      const response = await api.get('/api/owner/my-trips');
      setBookings(response.data);
    } catch (error) {
      console.error('Error fetching trips:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleCancel = async (bookingId: number) => {
    if (!window.confirm('Are you sure you want to cancel this booking?')) return;

    try {
      await api.post(`/api/owner/cancel-booking/${bookingId}`);
      fetchTrips();
    } catch (error) {
      console.error('Error cancelling booking:', error);
    }
  };

  const handleViewReceipt = async (bookingId: number) => {
    try {
      const response = await api.get(`/api/owner/booking-receipt/${bookingId}`);
      setSelectedBooking(response.data);
    } catch (error) {
      console.error('Error fetching receipt:', error);
    }
  };

  if (loading) return <div>Loading...</div>;

  const getStatusBadge = (status: string) => {
    const statusMap: { [key: string]: string } = {
      pending: 'badge-pending',
      confirmed: 'badge-confirmed',
      rejected: 'badge-rejected',
      cancelled: 'badge-cancelled',
    };
    return statusMap[status] || 'badge-secondary';
  };

  return (
    <div>
      <div className="card">
        <h2>My Trips (OWN-11)</h2>
        <table className="table">
          <thead>
            <tr>
              <th>Cottage ID</th>
              <th>Check-in</th>
              <th>Check-out</th>
              <th>Status</th>
              <th>Credits Used</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {bookings.map((booking) => (
              <tr key={booking.id}>
                <td>{booking.cottage_id}</td>
                <td>{new Date(booking.check_in).toLocaleDateString()}</td>
                <td>{new Date(booking.check_out).toLocaleDateString()}</td>
                <td>
                  <span className={`badge ${getStatusBadge(booking.status)}`}>{booking.status}</span>
                </td>
                <td>
                  {booking.weekday_credits_used} Weekday / {booking.weekend_credits_used} Weekend
                </td>
                <td>
                  <button
                    onClick={() => handleViewReceipt(booking.id)}
                    className="btn btn-secondary"
                    style={{ marginRight: '5px' }}
                  >
                    Receipt
                  </button>
                  {(booking.status === 'pending' || booking.status === 'confirmed') && (
                    <button
                      onClick={() => handleCancel(booking.id)}
                      className="btn btn-danger"
                    >
                      Cancel
                    </button>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        {bookings.length === 0 && <p>No trips found</p>}
      </div>

      {selectedBooking && (
        <div className="card" style={{ marginTop: '20px' }}>
          <h3>Booking Receipt (OWN-13)</h3>
          <p><strong>Booking ID:</strong> {selectedBooking.booking_id}</p>
          <p><strong>Status:</strong> {selectedBooking.status}</p>
          <p><strong>Property:</strong> {selectedBooking.property}</p>
          <p><strong>Cottage:</strong> {selectedBooking.cottage_id}</p>
          <p><strong>Check-in:</strong> {new Date(selectedBooking.check_in).toLocaleDateString()}</p>
          <p><strong>Check-out:</strong> {new Date(selectedBooking.check_out).toLocaleDateString()}</p>
          <p><strong>Credits:</strong> {selectedBooking.weekday_credits} Weekday / {selectedBooking.weekend_credits} Weekend</p>
          <p><strong>Total Credits:</strong> {selectedBooking.total_credits}</p>
          <p><strong>Guest Rules:</strong> {selectedBooking.guest_rules}</p>
          <button onClick={() => setSelectedBooking(null)} className="btn btn-secondary">
            Close
          </button>
        </div>
      )}
    </div>
  );
};

export default MyTrips;
